import { ReactDOM } from "react";
import pokemonList from './App';

const Pokemon = ({ id, name }) => (
    <div>
      <p>{id}</p>
      <p>{name}</p>
    </div>
  )

  const renderPokemon = () => {
    ReactDOM.render(
      pokemonList.map((pokemon) => (
        <Pokemon
          id={pokemon.id}
          name={pokemon.name}
          />
      )),
      document.getElementById('root')
    )
  }
